import AppHeader from './components/AppHeader';
import AppFooter from './components/AppFooter';
import Home from './components/Home'
import CategoryBookList from './components/CategoryBookList';
import Cart from './components/Cart';
import Checkout from './components/Checkout';
import {
    BrowserRouter as Router,
    Routes,
    Route,
} from "react-router-dom"
import axios from "axios";
import React, {useEffect, useState} from 'react';


function App() {

    axios.defaults.baseURL = "http://webdev.cs.vt.edu:8080/IAnBookstoreReactState/api/";
    // axios.defaults.baseURL = "http://localhost:8080/IAnBookstoreReactSession/api/";
    // const [categories, setCategories] = useState([]);
    // const [data, setData] = useState(0);

    const [categories, setCategories] = useState([]);
    const [data, setData] = useState(0);
    useEffect(() => {
        axios.get('categories')
            .then((result) => setCategories(result.data))
            .catch(console.error);
    }, []);

    return (
        <Router basename={"IAnBookstoreReactSession"}>
            <AppHeader/>
            <Routes>
                <Route path="/" element={<Home/>}/>
                <Route path="/categories" element={<CategoryBookList/>}>
                    <Route path=":catId" element={<CategoryBookList/>}/>
                </Route>
                <Route path="/cart" element={<Cart/>}/>
                <Route path="/checkout" element={<Checkout/>}/>
                <Route path="*" element={<div>Page Not Found</div>}/>
            </Routes>
            <AppFooter/>
        </Router>
    );
}

export default App;
